import './App.css';
import { Route, Switch } from 'react-router';
import Home from './pages/home/Home';
import Finder from './pages/find/Find'

function App() {
  return (
    <Switch>
      <Route exact path='/' component={Home}></Route>
      <Route exact path='/finder'><Finder/></Route>
    </Switch>
  );
}

export default App;
